import React from "react";
import FormGroup from "@material-ui/core/FormGroup";
import FormControlLabel from "@material-ui/core/FormControlLabel";
import Dialog from "@material-ui/core/Dialog";
import Checkbox from "@material-ui/core/Checkbox";
import { PinDropSharp } from "@material-ui/icons";

const AFastTableFilterOptionsDialog = (props) => {
  const dialogProps = {};
  if (props.handleClose !== undefined) dialogProps.onClose = props.handleClose;
  if (props.open !== undefined) dialogProps.open = props.open;

  return (
    <Dialog {...dialogProps}>
      <FormGroup>
        {props.optionValues.map((optionValue) => {
          <FormControlLabel
            control={
              <Checkbox
                defaultChecked
                name={"_filter_options_" + props.field}
                value={optionValue}
              />
            }
            label={optionValue}
          />;
        })}
      </FormGroup>
    </Dialog>
  );
};

export default AFastTableFilterOptionsDialog;
